import styles from "./Icons.module.css";
const Icons = () => {
  return (
    <div className={styles.icons}>
      <img className={styles.maskGroupIcon} alt="" src="/mask-group5@2x.png" />
      <img className={styles.logoIcon} alt="" src="/logo1.svg" />
      <img className={styles.maskGroupIcon1} alt="" src="/mask-group6@2x.png" />
      <img className={styles.image30Icon} alt="" src="/image-30@2x.png" />
      <img className={styles.maskGroupIcon2} alt="" src="/mask-group7@2x.png" />
      <img className={styles.maskGroupIcon3} alt="" src="/mask-group8@2x.png" />
      <img className={styles.image10Icon} alt="" src="/image-10@2x.png" />
      <img className={styles.image1Icon} alt="" src="/image-1@2x.png" />
      <img className={styles.image2Icon} alt="" src="/image-2@2x.png" />
      <img className={styles.maskGroupIcon4} alt="" src="/mask-group9@2x.png" />
      <img className={styles.image44Icon} alt="" src="/image-44@2x.png" />
      <img className={styles.image34Icon} alt="" src="/image-34@2x.png" />
      <img className={styles.image50Icon} alt="" src="/image-50@2x.png" />
      <img className={styles.image49Icon} alt="" src="/image-49@2x.png" />
      <img className={styles.image46Icon} alt="" src="/image-46@2x.png" />
      <img className={styles.image45Icon} alt="" src="/image-45@2x.png" />
    </div>
  );
};

export default Icons;
